const obj = JSON.parse(data)
module.exports = obj
let count = 0
let class_apis = []
let classArray = []

const headers = ["course id", "quarter", "id", "instructor", "class_title", "course_number", "prerequisite", "credits", "level", "meeting_days", "meeting_times", "gen_ed_req"]
classArray.push(headers)

let id
let course_id
let class_code
let class_title
let prereq
let genreq
let times
let days
let credits
let level
// add any course id to get use api
let api_string = 'https://course-app-api.planning.sis.uw.edu/api/courses/CSE%20121/details?courseId='
let result
let quarter
let instructor

// gets the data for the columns that we need
async function getData() {
    try {
        while (obj.classes[count] !== undefined) {
            id = obj.classes[count].id
            course_id = obj.classes[count].courseId
            class_code = obj.classes[count].code
            class_title = obj.classes[count].title
            prereq = obj.classes[count].prereqs
            genreq = obj.classes[count].genEduReqs
            credits = obj.classes[count].credit
            level = obj.classes[count].level
            result = api_string.concat(course_id)
            class_apis.push(result)
            let specData = await fetchData(result)
            let quarterNum = id.substring(0, 5)
            let num = 1
            let count2 = 0

            // makes sure the correct time is picked for each quarter
            if (quarterNum === '20234') {
                quarter = 'AU 23'
                while (specData.courseOfferingInstitutionList[0].courseOfferingTermList[count2].term !== undefined) {
                    if (specData.courseOfferingInstitutionList[0].courseOfferingTermList[count2].term === 'Autumn 2023') {
                        num = count2
                        break
                    }
                    count2++
                }
            } else if (quarterNum === '20233') {
                quarter = 'SU 23'
                count2 = 0
                while (specData.courseOfferingInstitutionList[0].courseOfferingTermList[count2].term !== undefined) {
                    if (specData.courseOfferingInstitutionList[0].courseOfferingTermList[count2].term === 'Summer 2023') {
                        num = count2
                        break
                    }
                    count2++
                }
            }

            days = specData.courseOfferingInstitutionList[0].courseOfferingTermList[num].activityOfferingItemList[0].meetingDetailsList[0].days
            times = specData.courseOfferingInstitutionList[0].courseOfferingTermList[num].activityOfferingItemList[0].meetingDetailsList[0].time
            instructor = specData.courseOfferingInstitutionList[0].courseOfferingTermList[num].activityOfferingItemList[0].instructor
            // puts the information of each class into an array
            const newClass = [course_id, quarter, id, instructor, class_title, class_code, prereq, credits, level, days, times, genreq]
            classArray.push(newClass)
            count++
        }
        saveCSV()
    } catch (error) {
//        console.log(obj.classes[count].id)
        console.log(error)
    }
}

// function to fetch data from each api
async function fetchData(result) {
    try {
        const response = await fetch(result)
        return await response.json()
    } catch (error) {
        console.log(error)
    }
}

getData()

