// converts the array to CSV format
function arrayToCSV(data) {
    return data.map(row =>
        row
            .map(String)
            .map(v => v.replaceAll('"', '""'))
            .map (v => `"${v}"`)
            .join(',')
    ).join('\r\n')
}

// saves the CSV
function saveCSV() {
     let csv = arrayToCSV(classArray)
     const fs = require('fs')
     fs.writeFile('courses.csv', csv, err => {
         if (err) {
             console.error(err)
         }
     })
}


